      FILTER (?o = dbr:Prince_Louis_of_Battenberg)
    } AS ?hasSpouse)
    BIND(COALESCE(?spouse, "No spouse found") AS ?spouseResult)
  }
  BIND(CONCAT("Parent of Louise Mountbatten: ", ?parentResult, "\nSpouse of Prince Louis of Battenberg: ", ?spouseResult) AS ?result)
}

